  KEY `dashboard_menucardmaster_created_by_id_d4e5c3cc` (`created_by_id`),
  KEY `dashboard_menucardmaster_status_id_435bd8dc` (`status_id`),
  KEY `dashboard_menucardmaster_updated_by_id_3a1a2b2f` (`updated_by_id`)
